I've started working on a script to auto add the hygieia publisher build steps to Jenkins jobs. The below is what I have so far. The script works and will add the build step to the jobs. However, I am stuck on passing the right value to enable 'Publish Build Status' in the HygieiaPublisher contructor. If someone could help point me in the right direction that would be great

for (item in Hudson.instance.items) {
  if (item instanceof com.cloudbees.hudson.plugins.folder.Folder || item instanceof org.jenkinsci.plugins.workflow.job.WorkflowJob){
    println(item.name + " can't include, skipping")
  }else{
  notification = item.getPublishersList()
  if(notification.empty){
     println("$item.name doesn't have the hygieia plugin installed")
     hygieia = new jenkins.plugins.hygieia.HygieiaPublisher(null, null, null, null, null)
     item.getPublishersList().add(hygieia)
     item.save()
  }else{
    for(n in notification){
  		n = (String)n
  		if (n.contains("jenkins.plugins.hygieia.HygieiaPublisher")) {
    	println("$item.name does have the hygieia plugin installed")
  			}
        else if ((n.contains("jenkins.plugins.hygieia.HygieiaPublisher")) == false){
      		println("$item.name doesn't have the hygieia plugin installed")
    	}
    	}
  	}
  }
 
}

This catches all exceptions when the collector attempts to retrieve a configuration change and logs it so that it does not prevent the collector task from collecting data for any other sonar urls

It also only retrieves config changes for Sonarqube versions greater than 5.0

